import { NgModule } from '@angular/core';
import { HttpClientModule } from '@angular/common/http';

import { FormsModule, ReactiveFormsModule } from "@angular/forms";
import { AppComponent } from "./app.component";
import { BrowserModule } from "@angular/platform-browser";
import { SimpleHttpComponent } from './httpRequests/simple-http/simple-http.component';
import { MoreHttpRequestsComponent } from './httpRequests/more-http-requests/more-http-requests.component';
import { YouTubeSearchComponent } from './httpRequests/you-tube-search/you-tube-search.component';
import { SearchResultsComponent } from './httpRequests/search-results/search-results.component';
import { SearchBoxComponent } from './httpRequests/search-box/search-box.component';

@NgModule ({
    declarations: [
        AppComponent,
        SimpleHttpComponent,
        MoreHttpRequestsComponent,
        YouTubeSearchComponent,
        SearchResultsComponent,
        SearchBoxComponent
    ],
    imports: [
        BrowserModule,
        FormsModule,
        ReactiveFormsModule,
        HttpClientModule
    ],
    providers: [],
    bootstrap: [AppComponent]
})

export class AppModule{}
